import axios from 'axios';

const getMatches = (callback) => {
    axios.get('http://localhost:23204/api/match/search',
        {
            headers: {
                'Access-Control-Allow-Origin': '*',
            }
        }
    ).then((res) => {
        callback(res.data);
    })
}

const getPlayers = (callback) => {
    axios.get('http://localhost:23204/api/player/get',
        {
            headers: {
                'Access-Control-Allow-Origin': '*',
            }
        }
    ).then((res) => {
        callback(res.data);
    })
}

const getSimplePlayers = (callback) => {
    axios.get('http://localhost:23204/api/player/simple/get',
        {
            headers: {
                'Access-Control-Allow-Origin': '*',
            }
        }
    ).then((res) => {
        callback(res.data);
    })
}

const getLastMatchID = (callback) => {
    axios.get('http://localhost:23204/api/match/index',
        {
            headers: {
                'Access-Control-Allow-Origin': '*',
            }
        }
    ).then((res) => {
        callback(res.data);
    })
}

const getVenues = (callback) => {
    axios.get('http://localhost:23204/api/venue/get',
        {
            headers: {
                'Access-Control-Allow-Origin': '*',
            }
        }
    ).then((res) => {
        callback(res.data);
    })
}

const getCourtWithVenue = (callback, venueName) => {
    axios.get('http://localhost:23204/api/court/get?venue=' + venueName,
        {
            headers: {
                'Access-Control-Allow-Origin': '*',
            }
        }
    ).then((res) => {
        callback(res.data);
    })
}

const createPlayer = (callback, state) => {
    axios.post('http://localhost:23204/api/player/create',
        {
            ...state
        }, {
        headers: {
            'Access-Control-Allow-Origin': '*',
        }
    }
    ).then((res) => {
        callback(res.data);
    }).catch((error) => {
        alert(error.response.data)
    })
}

const createNewMatch = (callback, state) => {
    axios.post('http://localhost:23204/api/match/full/create',
        {
            ...state
        }, {
        headers: {
            'Access-Control-Allow-Origin': '*',
        }
    }).then((res) => {
        callback(res.data)
    }).catch((error) => {
        alert(error.response.data)
    })
}

const createNewCourt = (callback, state) => {
    axios.post('http://localhost:23204/api/court/create',
        {
            ...state
        },
        {
            headers: {
                'Access-Control-Allow-Origin': '*',
            }
        }
    )
}

export {
    getMatches,
    getPlayers,
    getSimplePlayers,
    getLastMatchID,
    getVenues,
    getCourtWithVenue,
    createPlayer,
    createNewMatch
}
